import React from 'react';
import { Container, Row, Col, Card } from 'react-bootstrap';

function About() {
  return (
    <Container className="mt-3">
      <Row>
        <Col>
          <Card>
            <Card.Body>
              <Card.Title>About Esther Lee</Card.Title>
              <Card.Text>
                Esther Lee is a highly motivated and skilled Software Developer Engineer with a passion for developing innovative and efficient solutions. Currently enhancing the technological landscape at Amazon, she excels in developing scalable backend solutions for high-traffic e-commerce applications, embodying reliability and streamlined performance. With a knack for leading projects from concept to completion, she employs Agile methodologies to ensure timely delivery of critical features and enhancements.
                Her collaborative spirit is exemplified through her work with cross-functional teams, where she synergizes with product managers, designers, and other engineers to define project requirements and implement robust solutions. Estherâ€™s holistic approach to software development is evident in her tenure at Goldman Sachs and Boston College, where she streamlined workflow processes, integrated APIs, and developed both front-end and back-end components of applications. Her work on a user-friendly Chrome Extension as a personal project showcases her commitment to enhancing user experiences through intuitive design and interactive features.
                Esther's rich tapestry of experiences in diverse settings, coupled with her technical proficiency in JavaScript, HTML, and CSS, foregrounds her as a front-end engineer who can bring valuable perspectives and innovative solutions to the table. Her aptitude for understanding user needs, coupled with her ability to leverage technology to address these needs, make her a standout candidate poised to make significant contributions to any front-end development team. In essence, Esther combines technical acuity with a user-centric approach, embodying the qualities of a front-end engineer capable of shaping engaging and efficient digital experiences.
              </Card.Text>
              <Card.Link href="EstherLeeResume.pdf" target="_blank" rel="noopener noreferrer">
                View Esther's Resume
              </Card.Link>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default About;
